		function toeye(ev) {
		
			if (ev.nativeEvent instanceof MouseEvent) {
				if (!is_eye_clicked) {
					that.blockChafaf();
					chafaf.visible = false;
					is_eye_clicked = true;
		
					that.settin.eye_tmrn.gotoAndStop(1);
		
				} else {
					that.unblockChafaf();
					chafaf.visible = true;
					is_eye_clicked = false;
		
					that.settin.eye_tmrn.gotoAndStop(0);
				}
			}
		
		}
